function search(){var a=$("#petName").val();$.get("/home/search?name="+a,function(a){buildTablePets(a)})}function buildTablePets(a){if("[]"!=a){var b="<table class='table table-striped table-hover table-bordered'><thead><tr><th>name</th><th>price</th></tr></thead><tbody>",c=JSON.parse(a);for(x in c)b+="<tr><td>"+c[x].PetName+"</td><td>"+c[x].Price+"</td></tr>";b+="</tbody></table>",$("#petsTable").html(b)}else $("#petsTable").html("No results were found for your search")}$("#submitBtn").on("click",function(a){a.preventDefault(),search()});